import React,{Component} from 'react';
import {Container,Row,Col} from 'react-bootstrap'

class mycart extends Component{

    render(){
        return(
            <Container style={{paddingTop:40,maxWidth:1024}}>
                <Row>
                    <Col>
                        Product
                    </Col>
                    <Col>
                        Cart saya
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default mycart;
